;; **
;;; The posterior predictive of the Normal-inverse-Wishart distribution, given updated hyper-priors, is the multivariate t-distribution $$t_{{\nu}'-p+1}\left(\tilde{\mathbf{x}}|{\boldsymbol\mu_0}',\frac{{\lambda}'+1}{{\lambda}'({\nu}'-p+1)}\boldsymbol\Psi'\right),$$
;;; where @@p@@ is the cardinality of @@\Psi@@.
;;; 
;;; Let us introduce to Anglican the multivariate t-distribution and the "continuous" chi-squared distribution, on which the multivariate t-distribution depends:
;; **

;; @@
(defn produce-matrix-from-vector
  [input-vector]
  (m/matrix (m/reshape input-vector [(count input-vector) 1])))

(def get-zero-vector-as-matrix
  (memoize
   (fn [size]
    (produce-matrix-from-vector (repeat size 0)))))

;; Transforms Matrix type to standard Clojure vector data type.
(defn matrix-to-clojure-vector
  [matrix]
  (first (m/to-nested-vectors (m/transpose matrix))))

(defn continuous-chi-squared
  [nu]
  (let
    [
     ; Chi-Squared(nu) ~ Gamma(shape = nu / 2, scale = 2.0).
     ; In Colt library Gamma is parametrised in its second argument
     ; by rate, where scale = 1 / rate.
     gamma-dist (gamma (* nu 0.5) 0.5)]
  (reify distribution
    (sample [this]
      (sample gamma-dist))
    (observe [this value]
      (+
        (* (- (* nu 0.5) 1) (log value))
        (* -0.5 value)
        (* -0.5 nu (log 2))
        (* -1.0 (log-gamma-fn (* 0.5 nu))))))))

(defdist mvn-matrix
  "multivariate normal which returns a matrix 1 x N"
  [mean cov] [k (m/ecount mean)     ; number of dimensions
              Lcov (:L (linalg/cholesky (m/matrix cov)))
              unit-normal (normal 0 1)
              Z (delay (let [|Lcov| (reduce * (m/diagonal Lcov))]
                         (* 0.5 (+ (* k (Math/log (* 2 Math/PI)))
                                  (Math/log |Lcov|)))))
              iLcov (delay (m/inverse Lcov))
              transform-sample (fn [samples]
                                 (m/add mean (m/mmul Lcov samples)))]
  (sample [this] (transform-sample
                   (produce-matrix-from-vector (repeatedly k #(sample unit-normal)))))
  (observe [this value]
           (let [dx (m/mmul @iLcov (m/sub value mean))
                 dx (matrix-to-clojure-vector dx)]
             (- (* -0.5 (m/dot dx dx)) @Z)))
  multivariate-distribution
  (transform-sample [this samples] (transform-sample samples)))

(defn multivariate-t
  "Multivariate T-distribution."
  ; Implemented according to http://en.wikipedia.org/wiki/Multivariate_t-distribution
  [nu mu Sigma]
  (let
    [p (first (m/shape Sigma))
     mvn-dist (mvn-matrix (get-zero-vector-as-matrix p) Sigma)
     chi-squared-dist (continuous-chi-squared nu)]
    (reify distribution
      (sample [this]
              (let
                [y (sample mvn-dist)
                 u (sample chi-squared-dist)]
                (m/add
                 (m/mul y (sqrt (/ nu u)))
                 mu)))
      (observe [this value]

               (let
                 [mmul-result
                  (m/mget (m/mmul
                           (m/transpose (m/sub value mu))
                           (m/inverse Sigma)
                           (m/sub value mu)) 0 0)]
                 (-
                  (log-gamma-fn (* 0.5 (+ nu p)))
                  (+
                   (log-gamma-fn (* 0.5 nu))
                   (* 0.5 p (log nu))
                   (* 0.5 p (log Math/PI))
                   (* 0.5 (log (m/det Sigma)))
                   (* 0.5 (+ nu p)
                      (log
                       (+ 1.0
                          (* (/ 1.0 nu)
                             mmul-result)))))))))))
