;; **
;;; Once the new XRP is define, we can define the model using the new collapsed conjugate pair of the Normal-inverse-Wishart prior and Normal emissions:
;; **

;; @@
;; Dirichlet-Categorical random process
;; Input: initial Dirichlet hyperparameters
;; Output: a random process that can
;;   produce: outputs hyperparameters of Dir-Cat conjugate pair
;;   absorb: given a sample, returns the same random process, with updated hyperparameters
(defproc dirichlet-discrete
  [alphas]
  [counts (vec (repeat (count alphas) 0))]
  (produce [this]
           (let [unnormalised-probabilities (m/add alphas counts)]
             (discrete unnormalised-probabilities)))
  (absorb [this sample]
          (dirichlet-discrete alphas
                                (assoc counts sample (inc (nth counts sample))))))

;; helper methods
(defn row-mean [data] (op// (reduce op/+ data) (m/row-count data)))
(defn invert
  ([W] (linalg/solve W))
  ([kappa W] (linalg/solve (op/* kappa W))))

;; bring required primitive procedures into our namespace
(use '[clojure.core.matrix :only [shape identity-matrix get-row]])

(defn arraysubvector-to-matrix
  [array-subvector]
  (m/reshape (m/to-vector array-subvector) (conj (m/shape array-subvector) 1)))

;; model definition
(with-primitive-procedures [row-mean invert shape identity-matrix get-row
                            mvn-conjugate-fast dirichlet-discrete
                            produce-matrix-from-vector arraysubvector-to-matrix]
  (defquery gmm-collapsed [data & [hyperparams]]
    (println "provided hyperparameters:" hyperparams)
    (let [[N D] (shape data)

          ;; there are many hyperparameters; we provide defaults
          K 		(:K 		hyperparams	10)
          alpha 	(:alpha		hyperparams	1.0)
          mu-0		(:mu-0		hyperparams (row-mean data))
          lambda-0 	(:lambda-0	hyperparams	(identity-matrix D))
          nu		(:nu		hyperparams	(inc D))
          kappa		(:kappa		hyperparams 1.0)
          create-mvn-process (fn [] (XRP (mvn-conjugate-fast (arraysubvector-to-matrix mu-0) kappa nu lambda-0)))

          ;; sample the latent variables.
          ;;
          ;; mu and sigma are per-cluster; ideally we would sample them lazily
          dirichlet-discrete-process (XRP (dirichlet-discrete (repeat K alpha)))
          mvn-process (into [] (repeatedly K create-mvn-process))]
      ;; for each data point, sample z[n] and `observe`
      (loop [n 0
             z []]
        (if (= n N)
          (predict :z z)
          (let [row (get-row data n)
                k (SAMPLE dirichlet-discrete-process)]
            (OBSERVE (get mvn-process k) (arraysubvector-to-matrix row))
            (recur (inc n) (conj z k))))))))
